import React from "react";

const Home = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-gray-800 amiri-font mb-6">
        الصفحة الرئيسية
      </h1>
      <p className="text-gray-600">
        مرحباً بك في منصة أصداء الإعلامية التراثية
      </p>
    </div>
  );
};

export default Home;
